#include <algorithm>
#include <numeric>
#include <string>
#include <unordered_set>
#include <vector>

#include <gtest/gtest.h>


using namespace std;

int lengthOfLongestSubstringBruteForce(string s)
{
    unordered_set<char> set;
    int length = 0;
    int count = 0;
    while (count != s.length())
    {
        set.clear();
        for (int i = count; i < s.length() + 1; ++i)
        {
            if (set.find(s[i]) != set.end() || s[i] == 0)
            {
                length = set.size() > length ? set.size() : length;
                set.clear();
            }
            
            set.emplace(s[i]);
        }
        count++;
    }

    return length;
}

