#define TEST_NAME longest_substring

TEST(TEST_NAME, empty)
{
    ASSERT_EQ(lengthOfLongestSubstring(""), 0);
}

TEST(TEST_NAME, simple)
{
    ASSERT_EQ(lengthOfLongestSubstring("abc"), 3);
}

TEST(TEST_NAME, repeating_characters)
{
    ASSERT_EQ(lengthOfLongestSubstring("abca"), 3);
    
    ASSERT_EQ(lengthOfLongestSubstring("abcdabcde"), 5);

    ASSERT_EQ(lengthOfLongestSubstring("aaabb"), 2);

    ASSERT_EQ(lengthOfLongestSubstring("dvdf"), 3);

    ASSERT_EQ(lengthOfLongestSubstring("asjrgapa"), 6);
}

